import React, { Component } from "react";
import { Form, Button, Input, Label, Col, FormGroup } from "reactstrap";
import { GeneratorInput as GeneratorColumnInput } from "./GeneratorColumnInput";

class GeneratorForm extends Component {
  constructor() {
    super();
    this.state = {
      numRows: "",
      fileType: "",
      generatorOptions: ""
    };
  }

  render() {
    return (
      <Form>
        <GeneratorColumnInput />
        <GeneratorColumnInput />
        <GeneratorColumnInput />
        <FormGroup row>
          <Col md={3}>
            <Label>Number of Rows:</Label>
            <Input
              type="number"
              name="numrows"
              id="numrows"
              onChange={e => this.setState({ numRows: e.target.value })}
            />
          </Col>
          <Col md={2}>
            <Label>Exported File Type:</Label>
            <Input
              type="select"
              name="filetype"
              id="filetype"
              onChange={e => this.setState({ fileType: e.target.value })}
            >
              <option>CSV</option>
              <option>Excel</option>
              <option>JSON</option>
            </Input>
          </Col>
        </FormGroup>
        <Button type="success" color="primary">
          Generate Data
        </Button>
      </Form>
    );
  }
}

export { GeneratorForm };
